    "A Line is a straight path that extends infinitely in both directions . It has no thickness and contains infinitely many points. A Line is named by any two points on it (e.g., Line AB, written ←→ AB) or by a lowercase letter.": "रेखा एक सीधा पथ है जो दोनों दिशाओं में अनंत रूप से विस्तारित होता है। इसकी कोई मोटाई नहीं है और इसमें अनंत रूप से कई बिंदु हैं। एक रेखा का नाम उस पर मौजूद किन्हीं दो बिंदुओं (उदाहरण के लिए, रेखा AB, ←→ AB लिखा जाता है) या छोटे अक्षर से दिया जाता है।",
    "A Line is a straight path that extends infinitely in both directions. It has no thickness and contains infinitely many points.": "रेखा एक सीधा रास्ता है जो दोनों दिशाओं में अनंत रूप से फैला हुआ है। इसकी कोई मोटाई नहीं है और इसमें अनंत रूप से कई बिंदु हैं।",
    "A Line is a straight path that extends infinitely in both directions. It has no thickness and contains infinitely many points. A Line is named by any two points on it (e.g., Line AB, written ←→ AB) or by a lowercase letter.": "",
    "A Line segment is a part of a Line bounded by two endpoints. Unlike a Line , a segment has a definite length . The length of segment AB is written as AB (without the bar above).": "एक रेखा खंड दो अंतिम बिंदुओं से घिरी रेखा का एक हिस्सा है। एक रेखा के विपरीत, एक खंड की एक निश्चित लंबाई होती है। खंड AB की लंबाई AB (उपरोक्त बार के बिना) के रूप में लिखी गई है।",
    "A Line segment is a part of a Line bounded by two endpoints. Unlike a Line, a segment has a definite length. The length of segment AB is written as AB (without the bar above).": "",
    "A Linear Pair consists of two adjacent angles that form a straight line.": "",
    "A Linear Pair is a pair of adjacent angles whose non-common sides form a straight Line. Linear pairs are always supplementary (sum to 180°).": "",
    "A Linear Pair is two adjacent angles that form a straight line. Their measures sum to 180°.": "एक रैखिक युग्म दो आसन्न कोण हैं जो एक सीधी रेखा बनाते हैं। इनका माप 180° होता है।",
    "A Plane contains at least three Collinear points \">Non- Collinear points .": "एक समतल में कम से कम तीन संरेख बिंदु होते हैं \">गैर-संरेख बिंदु।",
    "A Plane contains at least three Non-Collinear points .": "",
    "A Plane contains at least three Non-Collinear points.": "एक समतल में कम से कम तीन असंरेख बिंदु होते हैं।",
    "A Plane is a flat surface that extends infinitely in all directions . It has length and width but no thickness. A Plane is named by three Collinear points \">Non- Collinear points (e.g., Plane ABC) or by a capital letter.": "समतल एक सपाट सतह है जो सभी दिशाओं में अनंत रूप से फैली हुई है। इसकी लंबाई और चौड़ाई तो है लेकिन मोटाई नहीं है। एक विमान का नाम तीन संरेख बिंदुओं \">गैर-संरेख बिंदुओं (उदाहरण के लिए, विमान एबीसी) या एक बड़े अक्षर से रखा जाता है।",
    "A Plane is a flat surface that extends infinitely in all directions. It has length and width but no thickness.": "समतल एक सपाट सतह है जो सभी दिशाओं में असीमित रूप से फैली हुई है। इसकी लंबाई और चौड़ाई तो है लेकिन मोटाई नहीं है।",
    "A Plane is a flat surface that extends infinitely in all directions. It has length and width but no thickness. A Plane is named by three Non-Collinear points (e.g., Plane ABC) or by a capital letter.": "",
    "A Point can be located by (r, θ) where r is the distance from the origin and θ is the Angle from the positive x-axis.": "",
    "A Point is the most basic building block of geometry. It represents a location in space with no size, no width, no length, and no depth. Points are named with capital letters (e.g., Point A).": "एक बिंदु ज्यामिति का सबसे बुनियादी निर्माण खंड है। यह अंतरिक्ष में एक ऐसे स्थान का प्रतिनिधित्व करता है जिसका कोई आकार, कोई चौड़ाई, कोई लंबाई और कोई गहराई नहीं है। बिंदुओं को बड़े अक्षरों में नाम दिया गया है (उदाहरण के लिए, बिंदु ए)।",
    "A Point is the most basic building block of geometry. It represents a location in space with no size, no width, no length, and no depth. Points are named with capital letters.": "एक बिंदु ज्यामिति का सबसे बुनियादी निर्माण खंड है। यह अंतरिक्ष में एक ऐसे स्थान का प्रतिनिधित्व करता है जिसका कोई आकार, कोई चौड़ाई, कोई लंबाई और कोई गहराई नहीं है। बिंदुओं के नाम बड़े अक्षरों में रखे गए हैं।",
    "A Polygon is a closed figure formed by three or more Line segments (sides) that meet at their endpoints (vertices). Key properties:": "",
    "A Polygon is a closed plane figure formed by three or more line segments, where each segment intersects exactly two other segments.": "बहुभुज तीन या अधिक रेखा खंडों से बनी एक बंद समतल आकृति है, जहां प्रत्येक खंड दो अन्य खंडों को बिल्कुल काटता है।",
    "A Polyhedron is a three-dimensional figure with flat polygon faces, straight edges, and vertices.": "एक बहुफलक एक त्रि-आयामी आकृति है जिसमें सपाट बहुभुज फलक, सीधे किनारे और शीर्ष होते हैं।",
    "A Prism is a polyhedron with two parallel, congruent bases connected by rectangular faces.": "प्रिज्म एक बहुफलक है जिसके दो समानांतर, सर्वांगसम आधार आयताकार फलकों से जुड़े होते हैं।",
    "A Pyramid is a polyhedron with a polygon base and triangular faces that meet at a vertex (apex).": "पिरामिड एक बहुफलक है जिसका आधार बहुभुज और त्रिकोणीय फलक एक शीर्ष (शीर्ष) पर मिलते हैं।",
    "A Pythagorean triple is a set of three positive integers (a, b, c) such that a² + b² = c². Example: (3, 4, 5).": "",
